import React from 'react';
import Navbar from './Navbar';
import { NavLink } from 'react-router-dom';

const Home = () => {
    return (
        <>
            <Navbar />

            <div className="container">
                <div className="row">
                    <div className='first'>
                        <h1>Start with you carrer with us</h1>
                        <span>Singh Incorporated</span>
                        <div></div>
                        <NavLink>Get Started</NavLink>
                    </div>
                    <div className='second'>
                        <p>

                            Lorem ipsum dolor sit amet consectetur adipisicing elit. Explicabo quia aliquid, maiores nostrum excepturi officia repellat recusandae vel quisquam, blanditiis voluptatem. Perspiciatis eveniet doloribus distinctio officiis doloremque labore quasi illo.
                        </p>
                    </div>
                </div>
            </div>
        </>
    )
}
export default Home;
